import React from "react";
import PaginationStyles from "./styles/PaginationStyles";
import gql from "graphql-tag";

const PAGINATION_QUERY = gql`
  songsConnection {
    aggregate {
      count
    }
  }
`;

const Pagination = () => {
  return (
    <PaginationStyles>
      <p>Hi I'm the pagination</p>
    </PaginationStyles>
  );
};

export default Pagination;
